import React, {useState} from "react"
import '../css/main.css';

const Main = (props) =>{
    const history = useHistory();

    if(typeof props.accountInfo === 'object' && props.accountInfo !== null)
        history.push("/main")
    
    if(props.accountInfo === true)
        return(
            <div>this is Home</div>
        )
}

export default Main;
